import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, id }){

    const q = getQuestionId();

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>
            <h1>{q.title}</h1>

        </Paper>
    )
}

export default Question;
